INSERT INTO `videos` (`videos_id`, `imdbid`, `title`, `slug`, `description`, `stars`, `director`, `writer`, `rating`, `release`, `country`, `genre`, `video_type`, `runtime`, `video_quality`, `publication`, `trailer`, `enable_download`, `focus_keyword`, `meta_description`, `tags`, `imdb_rating`, `is_tvseries`, `total_rating`, `total_view`) VALUES
(1, '', 'Deadpool 2', 'deadpool-2', '<p><span style=\"background-color: rgb(249, 249, 249); color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\">Wisecracking mercenary Deadpool meets Russell, an angry teenage mutant who lives at an orphanage. When Russell becomes the target of Cable -- a genetically enhanced soldier from the future -- Deadpool realizes that he\'ll need some help saving the boy from such a superior enemy. He soon joins forces&nbsp;</span><span class=\"yZlgBd\" style=\"background-color: rgb(249, 249, 249); display: inline; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\">with Bedlam, Shatterstar, Domino and other powerful mutants to protect young Russell from Cable and his advanced weaponry</span><br></p>', '', NULL, NULL, '0', '2018-09-11', NULL, NULL, NULL, '', 'HD', 1, 0, 1, '', '                                                    ', '', '', 0, 1, 7),
(2, '', 'Deadpool 2: The Super Duper Cut', 'deadpool-2-the-super-duper-cut', '<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\">Wisecracking mercenary Deadpool meets Russell, an angry teenage mutant who lives at an orphanage. When Russell becomes the target of Cable -- a genetically enhanced soldier from the future -- Deadpool realizes that he\'ll need some help saving the boy from such a superior enemy. He soon joins forces&nbsp;</span><span class=\"yZlgBd\" style=\"display: inline; color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small;\">with Bedlam, Shatterstar, Domino and other powerful mutants to protect young Russell from Cable and his advanced weaponry.</span><br></p>', '', NULL, NULL, '0', '2018-05-15', NULL, '12,41,42', NULL, '2 Hours', 'HD', 1, 0, 1, '', '', '', '7.9', 0, 1, 10);
